import React, { useState } from "react";
import FileUpload from "../components/FileUpload";

const Preprocessing = () => {
  const [data, setData] = useState(null);

  return (
    <div className="p-4">
      <h2 className="text-xl font-bold">Upload and Preprocess Data</h2>
      <FileUpload onFileProcessed={setData} />
      {data && <pre className="mt-4 bg-gray-200 p-2">{JSON.stringify(data, null, 2)}</pre>}
    </div>
  );
};

export default Preprocessing;
